import React from 'react';

const Input = props => {
  return (
    <div className='row'>
      <div className='col s3 m3 l3'>
        <button onClick={() => props.one(props.id, 1)}>+</button>
      </div>
      <div className='col s6 m6 l6'>
        <input
          className='col s12 m12 l12'
          type='number'
          id={props.id}
          value={props.req}
          onChange={props.change}
          autoFocus
        />
      </div>
      <div className='col s3 m3 l3'>
        <button onClick={() => props.one(props.id, -1)}>-</button>
      </div>
    </div>
  );
};

export default Input;
